import React from 'react';
import './index.css';

import { render } from "react-dom";
import {
  FirebaseDatabaseProvider,
  FirebaseDatabaseNode
       } from "@react-firebase/database";
import * as firebase from "firebase/app";
import "@firebase/database";
import { config } from "./config";

const styles = {
  fontFamily: "sans-serif"
};

const s = (a: any) => JSON.stringify(a, null, 2);

class App extends React.Component {
    state = {
      limit: 20
    };
    hitProper = {
      part:  0,
      power: 0,
      long:  0,
      span:  0
    }

    destructuring (string) {
      console.log("String"+string);
      if(string!==undefined){
        console.log('nomer'+string.indexOf(':'));

      if(string.indexOf(':')===0){
        this.hitProper.part=string.slice(1,2);
      }}
    }

    render() {
      return (
        <div style={styles}>
          <FirebaseDatabaseProvider firebase={firebase} {...config}>
            <FirebaseDatabaseNode  path="hits/" //  limitToFirst={this.state.limit}
                                   orderByKey  // orderByValue={"created_on"}
                                           >
              {d => {
                const object = d.value;
                let hitData = [];
                let value=33;
                for(let key in object){
                  hitData.push(object[key].original); 
                          }
                //Object.values(object);
                console.log('check'+hitData[hitData.length-2]);
                this.destructuring(hitData[hitData.length-2]);

                return (
                  <div><p>HI, it's test</p>
                  <img class="fit-picture" 
                       src="../body.png"
                          alt="a" //Grapefruit slice atop a pile of other slices"
                           />
                  <React.Fragment>
                    <pre>Path {d.path}</pre>
                    <pre style={{ height: 500, overflow: "auto" }}>
                      Value {hitData[hitData.length-2]} Part: {this.hitProper.part}
                    </pre>
                    <button
                      onClick={() => {
                        this.setState(state => ({ limit: state.limit + 2 }));
                      }}
                    >
                      Load more
                    </button>
                  </React.Fragment>
                  <label for="file">Hit progress:</label>
                  <progress id="file" max="100" value={value}> 70% </progress>

                  </div>
                );
              }}
            </FirebaseDatabaseNode>
          </FirebaseDatabaseProvider>
        </div>
      );
    }
  }

render(<App />, document.getElementById("root"));
